        public static int MinInRange(int[] values, int min, int max)
        {
            var items = values.Skip(min).Take(max - min).Where(x => x != 0);
            return items.Count() == 0 ? 0 : items.Max();
        }

        public int LengthOfLongestSubstring(string s, HashSet<char> used)
        {
            if (s.Length == 1)
                return 1;
            if (s.Length == 0)
                return 0;

            if (used.Contains(s[0]))
                return 0;

            var remainder = s.Substring(1);

            used.Add(s[0]);
            return Math.Max(LengthOfLongestSubstring(remainder, used) + 1, LengthOfLongestSubstring(remainder, new HashSet<char>()));

        }
